import React from 'react';
import s from './dialogs.module.css';

const Dialogs = (props) => {
    return(
        <div className='dialogs'>
            <div className='dialogs-items'>

                <div className='item'>
                    Luda
                </div>
                <div className='item'>
                    Sasha
                </div>
                <div className='item'>
                    Vika
                </div>
            </div>
        </div>
    )
};

export default Dialogs;
